26/Jul/24 12:55 PM;60957172a56f2f006f65f1e9;{noformat}// MeasureRelayTripTime measures the duration it takes for the main relay to open/close
// by reading the verivolt grid and inverter signal measurements, and stopping the trip timer
// when the logic condition is met, and returns the duration.
// nolint gocyclo function is complex because it checks both open/close instances.WIP
func MeasureRelayTripTime(open bool, logger *zap.Logger,
	loopDuration time.Duration) (time.Duration, error) {
	logger.Info("measuring_time_it_takes_the_main_relay_to_trip")

	const (
		_relayTripTolerance float64 = 0.01 // 1% tolerance for now.
	)

	var (
		gridVoltageData map[string]float64
		gridVoltageL1   float64
		gridVoltageL2   float64
		invVoltageData  map[string]float64
		invVoltageL1    float64
		invVoltageL2    float64
		duration        time.Duration
		err             error
	)

	gridSignals := []string{
		"vv_grid1_ac_voltage", // verivolt grid L1-N voltage.
		"vv_grid2_ac_voltage", // verivolt grid L2-N voltage.
	}

	inverterSignals := []string{
		"vv_line1_ac_voltage", // verivolt inverter L1-N voltage.
		"vv_line2_ac_voltage", // verivolt inverter L2-N voltage.
	}

	deltaGridL1 := gridVoltageL1 * _relayTripTolerance
	deltaGridL2 := gridVoltageL2 * _relayTripTolerance
	timerStart := time.Now()

	if open {
		for time.Since(timerStart) < loopDuration {
			gridVoltageData, err = ReadSignal(gridSignals, ReadSignalDuration, logger)
			if err != nil {
				return 0, fmt.Errorf("failed_to_read_signal")
			}
			gridVoltageL1 = gridVoltageData["vv_grid1_ac_voltage"]
			gridVoltageL2 = gridVoltageData["vv_grid2_ac_voltage"]

			invVoltageData, err = ReadSignal(inverterSignals, ReadSignalDuration, logger)
			if err != nil {
				return 0, fmt.Errorf("failed_to_read_signal")
			}
			invVoltageL1 = invVoltageData["vv_line1_ac_voltage"]
			invVoltageL2 = invVoltageData["vv_line2_ac_voltage"]

			if invVoltageL1 > gridVoltageL1+deltaGridL1 ||
				invVoltageL1 < gridVoltageL1-deltaGridL1 ||
				invVoltageL2 > gridVoltageL2+deltaGridL2 ||
				invVoltageL2 < gridVoltageL2-deltaGridL2 {
				logger.Info("open_relay_condition_met")
				break
			}
			time.Sleep(BusyWaitingDelay)
		}
		duration = time.Since(timerStart)
		logger.Info("time_taken_to_meet_relay_recondition", zap.Duration("duration", duration))
	} else {
		for time.Since(timerStart) < loopDuration {
			gridVoltageData, err = ReadSignal(gridSignals, ReadSignalDuration, logger)
			if err != nil {
				return 0, fmt.Errorf("failed_to_read_signal")
			}
			gridVoltageL1 = gridVoltageData["vv_grid1_ac_voltage"]
			gridVoltageL2 = gridVoltageData["vv_grid2_ac_voltage"]

			invVoltageData, err = ReadSignal(inverterSignals, ReadSignalDuration, logger)
			if err != nil {
				return 0, fmt.Errorf("failed_to_read_signal")
			}
			invVoltageL1 = invVoltageData["vv_line1_ac_voltage"]
			invVoltageL2 = invVoltageData["vv_line2_ac_voltage"]

			if invVoltageL1 <= gridVoltageL1+deltaGridL1 &&
				invVoltageL1 >= gridVoltageL1-deltaGridL1 &&
				invVoltageL2 <= gridVoltageL2+deltaGridL2 &&
				invVoltageL2 >= gridVoltageL2-deltaGridL2 {
				logger.Info("closed_relay_condition_met")
				break
			}
			time.Sleep(BusyWaitingDelay)
		}
		duration = time.Since(timerStart)
		logger.Info("time_taken_to_meet_relay_recondition", zap.Duration("duration", duration))
	}

	// Return if the condition is not met within loopDuration.
	if duration == 0 {
		return 0, fmt.Errorf("relay_condition_not_met_within_allowed_duration")
	}

	return duration, nil
}{noformat}

29/Jul/24 5:25 AM;60957172a56f2f006f65f1e9;{noformat}type RelayStates struct{
		MainRelayState float64
		GenRelayState float64
		PvRelayState float64
	}

func ValidateRelayStates(mainRelaySignal string, genRelaySignal string,
	pvRelaySignal string, logger *zap.Logger) (RelayStates, error) {
	logger.Info("validating_the_postion_of_the_main_and_branch_relays")

	relaySignals := []string{
		mainRelaySignal,
		genRelaySignal,
		pvRelaySignal,
	}

	relayStateCondition := false
	relayData, err := ReadSignal(relaySignals, ReadSignalDuration, logger)
	if err != nil {
		return RelayStates{}, fmt.Errorf("failed_to_read_signal")
	}
	mainRelayState := relayData[mainRelaySignal]
	genRelayState := relayData[genRelaySignal]
	pvRelayState := relayData[pvRelaySignal]

	if mainRelayState != genRelayState &&
		pvRelayState != genRelayState {
		relayStateCondition = true
		logger.Info("relay_state_combinations_supported_in_relay_state_truth_table")
	}

	logger.Info("main_relay_state", zap.String("signal", mainRelaySignal),
		zap.Float64("relay_state", mainRelayState)) // main relay log.
	logger.Info("gen_relay_state", zap.String("signal", genRelaySignal),
		zap.Float64("relay_state", genRelayState)) // gen relay log.
	logger.Info("pv_relay_state", zap.String("signal", pvRelaySignal),
		zap.Float64("relay_state", pvRelayState)) // pv relay log.

	if !relayStateCondition {
		return RelayStates{}, fmt.Errorf("relay_state_combinations_not_supported_in_relay_state_truth_table")
	}

	relayStates := &RelayStates{
		MainRelayState: mainRelayState,
		GenRelayState:  genRelayState,
		PvRelayState:   pvRelayState,
	}

	return *relayStates, nil
}{noformat}

28/Jun/24 10:27 AM;712020:6db8ec7c-44cf-4e10-b192-736802f9538b;

I am blocked by the influxClient which is currently being tested and validated by Seun. influxClient replaces canClient in the factory automation framework for reading CAN and analog signals on the SW. canClient was observed to be unable to simultaneously read CAN and analog signals; it was either one or the other when scripts were executed.

 

The issue has been improved, with the only exception now being the inability to read Manta signals on the system. Manta signals are used in islanding.go to validate the test, hence why I have put this issue on hold, as I am unable to validate it.

